import React,{ Component } from 'react';

class SpecialOffers extends Component {


	render(){

		return(
				<div className="container">
					<div className="row">
						<div class="header-l2">
							<div class="title">Special Offers</div>
								<div class="MuiGrid-root sub-title MuiGrid-container MuiGrid-justify-xs-space-between"><span class="text"></span>
								</div>
							</div>
					</div>
				</div>
		)
	}
}

export default SpecialOffers;
